        console.log(g);

        console.log(Object.keys(jj).includes(g));

        console.log(jj.filter(obj => Object.keys(obj).some(key => obj[key].includes(g))));

    }


    return (
        <>
            <button onClick={hjh}>hjh</button>
        </>
    );
}

export default Auth;
